Select cells according to the strategies

    var stragegy = new Strategy({
        cells: cells,
        color: color
    });
    var cell = strategy.select([
        strategy.mostReversable,
        strategy.edge
    ]);

Create new stragety.

    var strategy = this.strategy;
    var cell = strategy.select([
        strategy.mostReversable,
        strategy.edge
    ]);

See {{#crossLink "Strategy"}}{{/crossLink}}

Return this cell's row and col data.

    var cell = this.collection.search(3, 5);
    var point = cell.getPoint();
    point[0]; // 3
    point[1]; // 5

    var point = cell.getPoint(true);
    point.row; // 3
    point.col; // 5

Return this cell's (row, col)

    var cell = this.collection.search(3, 5);
    cell.toString() // '(row, col) = (3, 5)'
